const calculateSegmentsForHourRange = (start, end) => {
    const segments = [];
    const startSegment = (start - 1) * 5;
    const endSegment = (end * 5) - 1;

    for (let i = startSegment; i <= endSegment; i++) {
        segments.push(i);
    }
    return segments;
};
